export default function Progress(theme: any): {
    MuiLinearProgress: {
        styleOverrides: {
            root: {
                borderRadius: number;
                overflow: string;
            };
            bar: {
                borderRadius: number;
            };
            colorPrimary: {
                backgroundColor: any;
            };
            buffer: {
                backgroundColor: string;
            };
        };
    };
};
